.header {
  &__container {
    @include flex(column-reverse, flex-start, center);
    padding: 20px 0;
  }
  &__wrapper {
    @include flex(row, space-between, center);
    width: 85%;
    margin: 0 auto;
  }
  &__logo {
    text-transform: capitalize;
    font-size: 1.4rem;
    font-family: $accent;
  }
  .hamburger {
    padding: 0 10px;
    &__line {
      background-color: black;
      width: 35px;
      height: 2px;
      margin: 10px 0;
    }
    // :nth-child(1) {
    // }
    :nth-child(2) {
      width: 20px;
      margin-left: 10px;
    }
    // :nth-of-type(3) {
    // }
  }
  &__input-container {
    margin-top: 40px;
  }
  &__input {
    border: none;
    border-bottom: 1px solid black;
    padding-left: 10px;
    margin-left: 10px;
  }
  .nav {
    width: 100%;
    text-align: center;
    position: relative;
    bottom: 50px;
    background-color: $light-gray;
    @include flex(column-reverse, flex-start, flex-start);
    padding: 70px 0;
  }
  .nav * {
  }
  &__list {
    width: 100%;
    text-transform: uppercase;
  }
  &__link {
    display: inline-block;
    margin-top: 30px;
  }
  &__social {
    margin-top: 70px;
    width: 100%;
    @include flex(row, center, center);
  }
  &__icon {
    margin: 0 10px;
  }
}

